  let daku = 0; // 濁音・半濁音の状態を管理するための変数
  
// 平仮名ボタンを長押ししたときの処理
function handleKanaMouseDown(event) {
    isLongPress = false;
    const button = event.currentTarget;
    button.classList.add('animate'); // アニメーションのクラスを追加
  
    longPressTimer = setTimeout(() => {
      isLongPress = true;
      const kanaData = button.dataset.kana.split(',');
      const kana = kanaData[0];
      const type = kanaData[1];
      const fileName = kanaData[2];
  
      if (type === '1' || type === '3') {
        const audioData1 = audioData[fileName];
        const audio = new Audio(audioData1);
        audio.play();
        if(daku != 0){
            daku = 0
            renderKana()
        }
      } else if (type === '2') {
        if(kana=="□゛"){
            if(daku == 1){
                daku = 0
            } else {
                daku = 1
            }
        } else {
            if(daku == 2){
                daku = 0
            } else {
                daku = 2
            }
        }
        renderKana();
      } else if (type === '4') {
        sendMessage();
        renderKana();
      }
  
      button.classList.add('burst'); // 発音時にバーストアニメーションを追加
      setTimeout(() => {
        button.classList.remove('animate', 'burst'); // アニメーションのクラスを削除
      }, 300); // バーストアニメーションの時間（ミリ秒）
    }, 500); // 長押しの判定時間（ミリ秒）
  }

  // 平仮名ボタンを離したときの処理
  function handleKanaMouseUp(event) {
    clearTimeout(longPressTimer);
    const button = event.target;
    button.classList.remove('animate'); // アニメーションのクラスを削除

  }

  let longPressTimer;
  let touchStartTime;
  
  // 平仮名ボタンをタッチ開始したときの処理
  function handleKanaTouchStart(event) {
    if (event.target.nodeName === '#text') return;
    touchStartTime = new Date().getTime();
    const button = event.currentTarget;
    button.classList.add('animate');
    longPressTimer = setTimeout(() => {
      // ロングタップ処理
      handleLongPress(button);
    }, 500);
  }
  
  // 平仮名ボタンをタッチ終了したときの処理
  function handleKanaTouchEnd(event) {
    clearTimeout(longPressTimer);
    const button = event.target;
    button.classList.remove('animate');
    const touchEndTime = new Date().getTime();
    const touchDuration = touchEndTime - touchStartTime;
    if (touchDuration < 500) {
      // タップ処理
      handleTap(button);
    }
  }
  
  // ロングタップ時の処理
  function handleLongPress(button) {
    isLongPress = true;
    const kanaData = button.dataset.kana.split(',');
    const kana = kanaData[0];
    const type = kanaData[1];
    const fileName = kanaData[2];
    if (type === '1' || type === '3') {
      const audioData1 = audioData[fileName];
      const audio = new Audio(audioData1);
      audio.play();
      if(daku != 0){
        daku = 0
        renderKana()
      }      
    } else if (type === '2') {
        if(kana=="□゛"){
            if(daku == 1){
                daku = 0
            } else {
                daku = 1
            }
        } else {
            if(daku == 2){
                daku = 0
            } else {
                daku = 2
            }
        }
        renderKana();
    } else if (type === '4') {
      sendMessage();
      renderKana();
    }
    button.classList.add('burst');
    setTimeout(() => {
      button.classList.remove('animate', 'burst');
    }, 300);
  }

  // AIとの連携
  async function sendMessage() {
    const text = 'こんにちは';

    const responseContainer = document.getElementById('response-container');
    responseContainer.innerHTML = '応答を待っています...';

    try {
        const response = await fetch('/chat?text=' + encodeURIComponent(text));
        const data = await response.json();

        if (data.error) {
            responseContainer.innerHTML = 'エラーが発生しました: ' + data.error;
        } else {
            responseContainer.innerHTML = data.response;
            speakText(data.response);
        }
    } catch (error) {
        responseContainer.innerHTML = 'エラーが発生しました: ' + error.message;
    }
}

function speakText(text) {
    if ('speechSynthesis' in window) {
        const utterance = new SpeechSynthesisUtterance(text);
        utterance.lang = 'ja-JP';
        speechSynthesis.speak(utterance);
    } else {
        alert('お使いのブラウザは音声合成をサポートしていません。');
    }
}
 
  // 平仮名の表を描画する関数
  function renderKana() {
    const appElement = document.getElementById('app');
    appElement.innerHTML = ''; // 既存の要素をクリア

    kana.forEach(group => {
        const rowElement = document.createElement('div');
        rowElement.classList.add('kana-row');
        appElement.appendChild(rowElement);

        group[daku].forEach(kanaData => {
        const [kana, type, fileName, tts, image] = kanaData;
        const button = document.createElement('button');
        
        if (type === '3') {
            // typeが3の場合、イメージを表示する
            const img = document.createElement('img');
            img.src = image;
            img.alt = kana;
            button.appendChild(img);
        } else {
            // typeが3以外の場合、テキストを表示する
            button.textContent = kana;
        }
        
        button.classList.add('kana-btn');
        button.dataset.kana = `${kana},${type},${fileName},${tts},${image}`;
        button.addEventListener('mousedown', handleKanaMouseDown);
        button.addEventListener('mouseup', handleKanaMouseUp);

        // タッチイベントの登録
        button.addEventListener('touchstart', handleKanaTouchStart);
        button.addEventListener('touchend', handleKanaTouchEnd);
        rowElement.appendChild(button);
        });
    });

    // すべての img 要素に対してイベントハンドラを設定
    const images = document.querySelectorAll('img');
    images.forEach(img => {
    img.addEventListener('contextmenu', e => {
        e.preventDefault();
        // 必要に応じて、代替の処理を記述
    });
    });

    adjustButtonSize();

}


// ボタンのサイズとフォントサイズを調整する関数
function adjustButtonSize() {
    const appContainer = document.getElementById('app-container');
    const containerWidth = appContainer.clientWidth;
    const containerHeight = appContainer.clientHeight;
    const rowCount = kana.length;
    const columnCount = kana[0][0].length;
    const buttonWidth = Math.floor((containerWidth - (columnCount - 1) * 10) / columnCount);
    const buttonHeight = Math.floor((containerHeight - (rowCount - 1) * 2) / rowCount);
  
    const buttons = document.getElementsByClassName('kana-btn');
    for (let i = 0; i < buttons.length; i++) {
      const button = buttons[i];
      const kanaText = button.textContent;
      button.style.width = buttonWidth + 'px';
      button.style.height = buttonHeight + 'px';
  
      // フォントサイズを調整
      let fontSize = buttonHeight * 0.8;
      if (kanaText.length > 1) {
        if (fontSize > buttonWidth / 2.5){
            fontSize = buttonWidth / 2.5
        }
      }
      button.style.fontSize = fontSize + 'px';
    }
  }

  // ウィンドウのリサイズ時にボタンの高さとフォントサイズを調整
  window.addEventListener('resize', adjustButtonSize);
    
